import React from 'react';
import MyComponent from './components/MyComponent';

import './App.css';
class App extends React.Component {
    setName() {
        return 'Hello';
    }

    render() {
        return (
            <div className="wrapper">
                <MyComponent />
            </div>
        );
    }
}

export default App;
